function processMonsterTargetMaxHP(vvSkipvv, vvvOverCharge, vvvHPNormal, vvvHPBoss) {
    var ppreturn = false;
    if (vvSkipvv) {
        return true;
    }

    var sizeRMonster = objMonsterTargetList.length;

    if (sizeRMonster > 0) {
        var maxTGId = 0;
        var maxTGHP = -1;
        for (ij = 0; ij < objMonsterTargetList.length; ij++) {
            var ii = objMonsterTargetList[ij].querySelector('div.chbd img[src="' + nbarGreenTxt + '"]').style.width.replace('px', '');
            var hpCurrentMonster = (ii / 120) * 100;
            var vIVRF = vvvHPNormal;

            if (fightBoss) {
                vIVRF = vvvHPBoss;
            }

            if (hpCurrentMonster > vIVRF || vvvOverCharge > 220) {
                ppreturn = true;
            } else {
                if (objMonsterTargetList.length === 1 && vvvOverCharge > 60) {
                    if (vRoundA >= vRoundB) {
                        ppreturn = true;
                    }
                }
            }

            if (hpCurrentMonster > maxTGHP) {
                maxTGHP = hpCurrentMonster;
                maxTGId = ij;
            }
        }
        objMonsterTarget = objMonsterTargetList[maxTGId];
    }

    return ppreturn;
}

