function selectBossTarget(vvSkipvv) {
    var bReturn = false;
    if (vvSkipvv) {
        return false;
    }
    var nameBoss = '[Manbearpig][White Bunneh][Mithra][Dalek][Konata][Mikuru Asahina][Ryouko Asakura][Yuki Nagato][Skuld][Urd][Verdandi][Yggdrasil][Invisible Pink Unicorn][Flying Spaghetti Monster][Rhaegal][Viserion][Drogon][Real Life]';
    var sizeRMonster = objMonsterTargetList.length;

    if (sizeRMonster > 0) {
        var vNameBC = objMonsterTarget.querySelector('div.fd2').childNodes[0].innerHTML;
        if (vNameBC.indexOf('__') !== -1) {
            vNameBC = vNameBC.substring(0, vNameBC.indexOf('__'));
        }
        if (nameBoss.indexOf('[' + vNameBC + ']') === -1) {
            for (ij = 0; ij < objMonsterTargetList.length; ij++) {
                var vNameBC2 = objMonsterTargetList[ij].querySelector('div.fd2').childNodes[0].innerHTML;
                if (vNameBC2.indexOf('__') !== -1) {
                    vNameBC2 = vNameBC2.substring(0, vNameBC2.indexOf('__'));
                }

                if (nameBoss.indexOf('[' + vNameBC2 + ']') !== -1) {
                    objMonsterTarget = objMonsterTargetList[ij];
                    bReturn = true;
                    break;
                }
            }
        } else {
            bReturn = true;
        }
    }
    return bReturn;
}

function validateNextMonster(vImgSpell, vIndexMonsterNext) {
    if (!monsterpane.querySelectorAll('div.btm1')[vIndexMonsterNext].querySelector('div.btm6 img[src="/y/e/wpn_stun.png"]')) {
        if (!monsterpane.querySelectorAll('div.btm1')[vIndexMonsterNext].querySelector('div.btm6 img[src="' + vImgSpell + '"]')) {
            if (monsterpane.querySelectorAll('div.btm1')[vIndexMonsterNext].querySelector('div.btm6').querySelectorAll('div img')) {
                if (monsterpane.querySelectorAll('div.btm1')[vIndexMonsterNext].querySelector('div.btm6').querySelectorAll('div img').length < 6) {
                    objMonsterTarget = monsterpane.querySelectorAll('div.btm1')[vIndexMonsterNext];
                }
            }
        }
    }
}

