// 212
function verifyWeaken(vvSkipvv) {

    if ((vvSkipvv || listMonsterSize <= vNumberOfMonsterUseSupport) && !fightBoss) {
        return true;
    }
    var vRandomWeaken = 0;

    conlog('verifyWeaken', 0);

    //50
    if (vMP > 45) {
        vRandomWeaken = 65;
        //70
        if (vMP <= 80) {
            vRandomWeaken = getRandomInt(0, 99);
        }
    }

    if (vRandomWeaken > (vRminv - vWKDiff) && vRandomWeaken < (vRmaxv + vWKDiff)) {

        if (currentMonsterSize !== -1) {

            var currentIndexMonsterNext = -1;

            randomMonsterTarget(false);

            if (currentIndexMonster !== currentMonsterSize) {
                currentIndexMonsterNext = parseInt(currentIndexMonster) + 1;

                if (strListMonster.charAt(currentIndexMonsterNext) !== 'x') {

                    validateNextMonster('/y/e/weaken.png', currentIndexMonsterNext);

                }

            }

            conlog('currentIndexMonsterNext = ' + objMonsterTarget.id, 0);

            if (objMonsterTarget.querySelector('div.btm6').querySelectorAll('div img')) {
                if (objMonsterTarget.querySelector('div.btm6').querySelectorAll('div img').length === 6) {
                    return true;
                }
            }

            var ii = objMonsterTarget.querySelector('div.chbd img[src="' + nbarGreenTxt + '"]').style.width.replace('px', '');
            var hpCurrentMonster = (ii / 120) * 100;

            if (hpCurrentMonster > 55 || (hpCurrentMonster > 20 && fightBoss)) {

                if (!objMonsterTarget.querySelector('div.btm6 img[src="/y/e/weaken.png"]')) {
                    if (verHaveStun(objMonsterTarget)) {
                        attackUseSkill('212');
                    }
                }

            }




        }

    }


    return true;

}



