function chkCNtier2() {

    conlog('chkCNtier2', 0);

    // ,'431'
    //,'Heartseeker'
    var currentSkillBarArray = document.querySelectorAll('div.bte img');

    var skillMeleeOrMageId = '431';
    var skillMeleeOrMageName = 'Heartseeker';

    if (modeFighting === 0) {
        skillMeleeOrMageId = '432';
        skillMeleeOrMageName = 'Arcane Focus';
    }

    var useSkill = ['' + skillMeleeOrMageId, '413', '422', '312', '421'];
    var useSkill_Name = ['' + skillMeleeOrMageName, 'Shadow Veil', 'Spark of Life', 'Regen', 'Absorbing Ward'];
    var haveSkill = [];
    var hsId = 0;

    for (var h = 0, hvalue; h < currentSkillBarArray.length; h++) {
        hvalue = currentSkillBarArray[h];
        var kk = (hvalue.onmouseover + "");

        var forCheck = kk.substring(kk.lastIndexOf(',') + 1, kk.lastIndexOf(')')).trim();

        var skillName = kk.substring(kk.indexOf("('") + 2, kk.indexOf("',"));

        var indexSkillUse = containsIndex(useSkill_Name, skillName);

        if (indexSkillUse !== -1) {
            if (forCheck !== "'permanent'") {
                var timeSkill = parseInt(forCheck);


                haveSkill[hsId] = indexSkillUse;
                hsId++;

                if (timeSkill < 10 && (indexSkillUse !== -1)) {

                    attackUseSkill(useSkill[indexSkillUse]);

                    break;
                }
            } else {
                haveSkill[hsId] = indexSkillUse;
                hsId++;
            }
        }

    }

    for (var us = 0, usskill; usskill = useSkill[us]; us++) {

        var vUseSkillName = useSkill_Name[us];
        var vUseSkillID = useSkill[us];

        if (haveSkill.length > 0) {

            if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf(vUseSkillName) === -1 && (checkHaveSkillBySID(vUseSkillID))) {

                for (var hs = 0, hsSS; hs < haveSkill.length; hs++) {
                    hsSS = haveSkill[hs];
                    if (usskill !== useSkill[hsSS]) {
                        //conlog('a', 0);
                        attackUseSkill(usskill);

                        break;
                    }

                }
            }
        } else {
            attackUseSkill(usskill);
            break;
        }

    }

}

