function verifyOvercharge(vvSkipvv, vMaxHpBoss) {

    if (vvSkipvv) {
        return true;
    }

    conlog('verifyOvercharge', 0);
    var vOverCh = vOC;

    if (vOverCh.length > 0) {
        var vOverCharge = parseInt(vOverCh);
        var vSPLimit = -1;
        if (modeFighting > 0) {
            vSPLimit = 101;
        } else if (modeFighting === 0) {
            vSPLimit = 80;
        }

        var vChkOVC = 200;
        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 1') !== -1) {
            vChkOVC = 80;
        }

        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 2') !== -1) {
            vChkOVC = 50;
        }

        if (vOverCharge > 180 && vSP > vSPLimit) {

            if ((document.getElementById('ckey_spirit').src + "") !== '/y/battle/spirit_a.png') {
                document.getElementById('ckey_spirit').click();
                return false;
            }

        } else {

            if (vOverCharge > vChkOVC && vSP <= vSPLimit) {
                if (modeFighting === 0) { // Mage
                    //Concussive Strike
                    if (processMonsterTargetMaxHP(false, vOverCharge, 80, 30)) {
                        attackUseSkill('2501');
                    }
                } else if (modeFighting === 1) { // 1H
                    //Shield Bash
                    if (processMonsterTargetMaxHP(false, vOverCharge, 50, vMaxHpBoss)) {
                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 2') !== -1) {
                            if (processMonsterTargetBtwHP(false, 10, 25)) {
                                attackUseSkill('2203');
                            }
                        }
                        //Chain 1
                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 1') !== -1) {
                            processMonsterTargetHaveStunned(false, vOverCharge, 40, 20);
                            attackUseSkill('2202');
                        }

                        attackUseSkill('2201');
                    }
                } else if (modeFighting === 2) { // 2H
                    //Great Cleave
                    if (processMonsterTargetMaxHP(false, vOverCharge, 50, vMaxHpBoss)) {

                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 2') !== -1) {
                            attackUseSkill('2303');
                        }

                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 1') !== -1) {
                            attackUseSkill('2302');
                        }

                        attackUseSkill('2301');
                    }
                } else if (modeFighting === 3) { // DW
                    //Iris Strike
                    if (processMonsterTargetMaxHP(false, vOverCharge, 50, vMaxHpBoss)) {

                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 2') !== -1) {
                            attackUseSkill('2403');
                        }
                        if (document.querySelectorAll('div.bte')[0].innerHTML.indexOf('Chain 1') !== -1) {
                            if (processMonsterTargetHaveBlind(false, vOverCharge, 40, 20)) {
                                attackUseSkill('2402');
                            }
                        }
                        attackUseSkill('2401');
                    }
                } else if (modeFighting === 4) { // Niten
                    //Skyward Sword
                    if (processMonsterTargetMaxHP(false, vOverCharge, 50, vMaxHpBoss)) {
                        attackUseSkill('2101');
                    }
                }
            }
        }
    }

    return true;
}

