//Show HP //copy script from Modoki
if (enableShowHPStat) {
    function HPBar() {
        this.array = document.body.querySelectorAll(".btm5:first-child");
        this.length = this.array.length;
        var css = document.styleSheets.item(0);
        css.insertRule(".hvhp{position: absolute; z-index: 10; top: -1px; color: #ff0; text-align: center; font-size: 8pt; font-weight: bolder; text-shadow: -1px -1px #000, -1px 1px #000, 1px -1px #000, 1px 1px #000; width: 120px;}", css.cssRules.length);
    }

    HPBar.prototype.setHP = function(count, value) {

        var w = this.array[count].children[0].children[0];
        if (w) {
            var node = document.createElement("div");
            node.className = "hvhp";
            node.textContent = Math.floor(value * ((w.width + 1) / 121)) + " / " + value;
            this.array[count].children[0].appendChild(node);
        }
    }


    var log = document.getElementById("togpane_log");
    if (log) {
        var text = log.textContent;

        if (text.indexOf("Battle Start!", text.length - 41) != -1) {
            var hpbar = new HPBar();

            var reg = /HP=(\d+)0\d+/g;
            if (text.length > 1000) reg.lastIndex = text.length - 1000;
            var data;
            var hpArray = [];
            var count = hpbar.length - 1;

            while ((data = reg.exec(text)) !== null) {
                hpArray[count] = data[1];
                hpbar.setHP(count, data[1]);
                count--;
            }

            localStorage.setItem("hvstat_modoki_hp", hpArray);

        } else {
            var hpbar = new HPBar();
            var hpArray = localStorage.getItem("hvstat_modoki_hp").split(",");

            if (hpArray.length === hpbar.length) {

                for (var i = 0; i < hpArray.length; i++) {
                    hpbar.setHP(i, hpArray[i]);
                }
            }
        }
    }
}
